import mapboxgl from 'mapbox-gl/dist/mapbox-gl.js'

mapboxgl.accessToken = 'pk.eyJ1IjoiYXF1YWltcGFjdCIsImEiOiJja2R0d2N3emswdzlwMnptcGliNTk4ZHNkIn0.jPYEzZD-aErgL25Zx9N_Kg';

class maps extends React.Component{

    constructor(props){
        super(props)
        this.mapContainer = React.createRef();
    }

    // var element = document.getElementById("mapGLSpace")
    render(){
        var map = new mapboxgl.Map({container: this.mapContainer.current, style:'mapbox://styles/mapbox/streets-v11'})
        return(
            <div>
                <div ref = {this.mapContainer} id="mapContainer"/>
            </div>
        )
    }
}

export default maps
